import React from "react";
import { VolumeProfileChart, XAxis, YAxis, CartesianGrid, Tooltip } from "recharts";
import volumeProfileBySessionChartData from "./VolumeProfileBySessionChartData.json";

const VolumeProfileBySessionChartComponent = () => {
  return (
    <VolumeProfileChart width={500} height={300} data={volumeProfileBySessionChartData}>
      <CartesianGrid />
      <XAxis dataKey="session" />
      <YAxis />
      <Tooltip />
    </VolumeProfileChart>
  );
};

export default VolumeProfileBySessionChartComponent;
